import React from 'react';
import queryString from 'query-string';

import './Video.css'

const Video = function({location}){
    const { name, room } = queryString.parse(location.search)
    return (
        <div className="outside__video--container">

            <h1>{name}</h1>
            <p>{room}</p>
        </div>
    )
}

export default Video;
